"use strict";(self.webpackChunkstatic_site=self.webpackChunkstatic_site||[]).push([[131],{131:e=>{e.exports=JSON.parse('[{"id":"0066902c-dfbc-4094-82d7-817c1e4533e0","slug":"san-mateo-county-pride-center","externalUrl":"https://sanmateopride.org/","tags":["transmasculine","non-binary","transfeminine","healthcare","mental-health","social-services"],"address":"1021 S El Camino Real, San Mateo, CA 94402, USA","phoneNumber":"650-591-0133","country":"US","provinceOrState":"CA","city":"San Mateo","county":"San Mateo County","latLng":[37.5569591,-122.3189073],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/san-mateo-county-pride-center-san-mateo","googleMapsUrl":"https://goo.gl/maps/uj5ogP9y4LboxZYD9","facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro Pride do Condado de San Mateo","description":"O Centro Pride do Condado de San Mateo é uma organização modelo de colaboração e uma loja única para a comunidade LGBTQ+. Oferecemos robustos programas e serviços para apoiar membros da comunidade LGBTQ+ de todas as idades, incluindo educação, treinamento, eventos comunitários, grupos de apoio de pares, programação diária, terapia clínica e gestão de casos."},{"id":"0db36ba9-b329-4a54-8302-d7810866457a","slug":"diyhrtcafe","externalUrl":"https://diyhrt.cafe","tags":["transfeminine","non-binary","transmasculine","healthcare","education-awareness"],"title":"DIYHRT.cafe","description":"Uma vibrante comunidade online e centro de conhecimento para indivíduos interessados em terapia de reposição hormonal faça-você-mesmo (HRT). O site deles é dedicado a fornecer um espaço seguro e inclusivo onde as pessoas possam acessar informações, recursos e apoio para a HRT autoadministrada. Seja você está explorando métodos alternativos, buscando orientação sobre dosagem e administração, ou simplesmente procurando se conectar com outros que compartilham experiências semelhantes, o DIYHRT.cafe oferece uma riqueza de insights valiosos, histórias pessoais e conselhos de especialistas para ajudá-lo a tomar decisões informadas sobre sua saúde e bem-estar."},{"id":"1873eb7a-2dcb-4346-bf6b-91a97237072f","slug":"nsw-service-for-the-treatment-and-rehabilitation-of-torture-and-trauma-survivors","externalUrl":"https://www.startts.org.au/","tags":["healthcare","mental-health","social-services"],"phoneNumber":"+61 (0)2 9646 6700","country":"AU","provinceOrState":"NSW","city":"Carramar","address":"152/168 The Horsley Dr, Carramar NSW 2163, Australia","latLng":[-33.8801011,150.9654668],"email":"stts-startts@health.nsw.gov.au","socialMedia":{"twitterUrl":"https://twitter.com/starttsNSW","facebookUrl":"https://www.facebook.com/STARTTSNSW","instagramUrl":"https://www.instagram.com/startts_nsw/","linkedinUrl":"https://www.linkedin.com/company/startts/","youtubeUrl":"https://www.youtube.com/user/starttsvideos"},"county":"City of Fairfield","title":"Serviço NSW para o Tratamento e Reabilitação de Sobreviventes de Tortura e Trauma","description":"STARTTS é uma organização especialista, sem fins lucrativos, que fornece tratamento psicológico culturalmente relevante, apoio e intervenções comunitárias para ajudar pessoas e comunidades a se recuperarem de tortura e traumas de refugiados e reconstruir suas vidas na Austrália. Eles também apoiam indivíduos LGBTQIA+ de origem de refugiados e solicitantes de asilo."},{"id":"18ba5d3d-c47d-47f8-90a4-2f353a1f13ce","slug":"ftmguideorg","externalUrl":"https://FTMGuide.org","tags":["non-binary","transmasculine","healthcare","clothing"],"title":"FTMGuide.org","description":"Uma plataforma online abrangente dedicada a apoiar os indivíduos que estão fazendo a transição de feminino para masculino (FTM). Seu site serve como um recurso confiável, oferecendo uma riqueza de informações, orientação e conexões com a comunidade para aqueles que estão embarcando em sua jornada FTM. Desde conselhos práticos sobre terapia hormonal e opções cirúrgicas até apoio à saúde mental e histórias pessoais, FTMGuide.org tem como objetivo capacitar os indivíduos com o conhecimento e os recursos de que precisam para navegar em sua transição com confiança e clareza."},{"id":"1e8cb769-f49b-4428-86ea-2c4cbec96905","slug":"transfemscienceorg","externalUrl":"https://transfemscience.org","tags":["transfeminine","non-binary","healthcare"],"title":"transfemscience.org","description":"Uma plataforma online inovadora dedicada a fornecer pesquisas baseadas em evidências, educação e recursos para a comunidade transgênero e não-binária, com um foco particular na terapia hormonal feminizante (FHT). Seu site serve como um hub vital para indivíduos que buscam informações confiáveis e atualizadas sobre os aspectos médicos, fisiológicos e psicológicos da FHT. Através de sua coleção abrangente de estudos revisados por pares, artigos de especialistas e guias práticos, seu site capacita indivíduos a tomar decisões informadas sobre sua transição e saúde."},{"id":"3b5a33bd-aba4-4205-9a86-293b172e38ee","slug":"genderdysphoriafyi","externalUrl":"https://genderdysphoria.fyi","tags":["transmasculine","non-binary","transfeminine","mental-health","support-groups","community-stories","education-awareness"],"title":"genderdysphoria.fyi","description":"Um recurso online confiável para pessoas que buscam conhecimento, apoio e compreensão sobre disforia de gênero. O site deles fornece uma riqueza de informações, recursos e conexões com a comunidade para capacitar indivíduos em sua jornada. De guias abrangentes sobre identidade de gênero e transição a histórias pessoais e conselhos de especialistas, eles se esforçam para criar um espaço seguro e inclusivo para todos."},{"id":"3f865b77-21e6-472e-be98-b2cfd999dafb","slug":"unitarian-universalist-association","externalUrl":"https://www.uua.org/","tags":["non-binary","support-groups","education-awareness","spiritual"],"address":"24 Farnsworth St, Boston, MA 02210, USA","phoneNumber":"(617) 742-2100","country":"US","provinceOrState":"MA","city":"Boston","county":"Suffolk County","latLng":[42.35163259999999,-71.04857050000001],"email":"info@uua.org","socialMedia":null,"title":"Associação Unitária Universalista","description":"Uma comunidade espiritual de mente aberta, coração aberto, apoiando as pessoas a liderar vidas de justiça, amor, aprendizado e esperança. A comunidade acolhe a diversidade, incluindo a comunidade transgênero, e incentiva a participação ativa em atos de justiça. Eles também oferecem recursos, apoio e defesa para várias questões sociais."},{"id":"4332f79d-1323-45ca-9b40-df63af9b7179","slug":"movement-advancement-project","externalUrl":"https://www.lgbtmap.org/","tags":["legal","healthcare","education-awareness"],"address":"1905 15th St #1097, Boulder, CO 80302, USA","email":null,"phoneNumber":"(303) 578-4600","country":"US","provinceOrState":"CO","city":"Boulder","county":"Boulder County","latLng":[40.0178641,-105.2763041],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/lgbtmap/","twitterUrl":"https://twitter.com/lgbtmap","instagramUrl":"https://www.instagram.com/lgbtmap/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Projeto Avanço do Movimento","description":"O Projeto Avanço do Movimento (MAP) é um think tank independente, sem fins lucrativos, que fornece pesquisa rigorosa, insight e comunicações que ajudam a acelerar a igualdade e oportunidade para todos. O MAP trabalha para garantir que todas as pessoas tenham uma chance justa de buscar saúde e felicidade, ganhar a vida, cuidar de quem amam, estarem seguras em suas comunidades e participarem da vida cívica."},{"id":"43609b17-7528-4c60-94b4-e90866144715","slug":"jordan-ross-communication-services","externalUrl":"https://www.jordanrosscommunication.com/","tags":["voice-training"],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":"https://www.instagram.com/jordanrosscommunication/","youtubeUrl":"https://www.youtube.com/channel/UC4o7h219hPYdBcPaFpgh9Yw","tiktokUrl":"https://www.tiktok.com/@jordanrosscommunication","twitchUrl":null,"patreonUrl":null},"title":"Jordan Ross Serviços de Comunicação","description":"Jordan Ross oferece coaching de fala, voz e comunicação para indivíduos trans, queer e que não se conformam com o gênero. Ele oferece coaching 1-On-1, cursos online, eventos, e o \'Programa de Coaching de Voz Interior\'. Sua abordagem incorpora programação neuro-linguística, hipnoterapia, instrução de yoga e coaching de respiração, com o objetivo de abordar não apenas aspectos físicos, mas também mentais, emocionais e energéticos da comunicação."},{"id":"4465cbb7-3513-41ae-8878-7a86ebbe9f6a","slug":"gender-dynamix-online-education-portal","externalUrl":"https://www.genderdynamix.org.za/","tags":["transfeminine","transmasculine","non-binary","legal","healthcare","education-awareness","support-groups","community-stories"],"address":"7, 10 Anson St, Observatory, Cape Town, 7925, South Africa","phoneNumber":"+27 (0)21 447 4797","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9368811,18.470378],"email":"info@genderdynamix.org.za","socialMedia":null,"town":"Observatory","title":"Portal de Educação Online Gender Dynamix","description":"A Gender Dynamix é uma organização sem fins lucrativos baseada na África que visa promover, avançar e proteger os direitos humanos de comunidades trans e de gênero diverso na África do Sul e em toda a África Austral. A organização conduz advocacia, facilita a construção de capacidades e fornece serviços diretos à comunidade. Eles também oferecem recursos online relacionados à saúde, programas educacionais e reconhecimento legal de gênero."},{"id":"47b17f76-670a-4835-8773-409d98934b91","slug":"sylvia-rivera-law-project","externalUrl":"https://srlp.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"address":"147 W 24th St #5th, New York, NY 10011, USA","phoneNumber":"212-337-8550","country":"US","provinceOrState":"NY","city":"New York","town":"Manhattan","county":"New York County","latLng":[40.744576,-73.9941166],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/sylvia-rivera-law-project-new-york?osq=sylvia+rivera+law+project","googleMapsUrl":"https://goo.gl/maps/sjGv8qoSZPe3XE2QA","facebookUrl":"https://www.facebook.com/sylviariveralawproject","twitterUrl":"https://www.twitter.com/srlp","instagramUrl":"https://instagram.com/sylviariveralawproject/","youtubeUrl":"https://www.youtube.com/user/SylviaRiveraLP","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Sylvia Rivera Law Project (SRLP)","description":"O Sylvia Rivera Law Project trabalha para garantir que todas as pessoas sejam livres para auto-determinar a identidade e expressão de gênero, independentemente de renda ou raça, e sem enfrentar assédio, discriminação ou violência. SRLP fornece auxílio jurídico, organiza campanhas, conduz treinamentos e administra um Comitê Consultivo de Prisioneiros. É incentivado o envolvimento da comunidade através de doações, voluntariado e associação."},{"id":"499aa5dd-d3c0-42f6-a686-853672f3c71e","slug":"erin-in-the-morning","externalUrl":"https://www.erininthemorning.com/","tags":["transfeminine","legal","healthcare","education-awareness"],"email":"null","socialMedia":{"facebook":"facebook.com/erininthemorning","email":"mailto:info@erininthemorning.com"},"title":"Erin Na Manhã","description":"Notícias e discussões sobre legislação e vida trans. Por Erin Reed · Com mais de 38.000 inscritos"},{"id":"4be75e80-8ce1-4f46-90f0-ad307cd1829b","slug":"equaldexcom","externalUrl":"https://EqualDex.com","tags":["transfeminine","non-binary","transmasculine","partner-resources"],"title":"EqualDex.com","description":"Uma plataforma online inovadora que visa criar um recurso abrangente e atualizado para os direitos globais da comunidade LGBTQ+. O site deles oferece um banco de dados centralizado de leis, políticas e atitudes da sociedade em relação aos direitos LGBTQ+ de todo o mundo. Ao mapear e visualizar dados sobre igualdade, inclusão e proteções legais, EqualDex.com oferece uma ferramenta poderosa para ativistas, pesquisadores e pessoas que procuram entender e defender os direitos LGBTQ+ em escala global. Explore os mapas interativos, navegue pelos perfis de cada país e mantenha-se informado sobre os mais recentes avanços e desafios enfrentados pela comunidade LGBTQ+ em todo o mundo."},{"id":"58738396-e4d7-424a-ba8d-59559e883f06","slug":"strandsfortransorg","externalUrl":"https://strandsfortrans.org","tags":["transfeminine","non-binary","transmasculine","friendly-businesses","makeup"],"title":"strandsfortrans.org","description":"Strands For Trans é uma rede global de indústrias e organizações de cabelo, beleza e bem-estar que procuram criar e inspirar experiências seguras e positivas para todos os convidados, especialmente convidados da comunidade trans."},{"id":"594ba858-974c-4c09-8fd4-f4bb35ca6c5f","slug":"pacific-center-for-human-growth","externalUrl":"https://www.pacificcenter.org/","tags":["mental-health","support-groups","healthcare","youth-services","education-awareness"],"address":"2712 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"510-548-8283","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8611143,-122.2593404],"socialMedia":{"yelpUrl":"https://www.yelp.com/biz/pacific-center-berkeley","googleMapsUrl":"https://goo.gl/maps/dSnoipA7TWiDN72b7","facebookUrl":"https://www.facebook.com/pacific.center","twitterUrl":null,"instagramUrl":"https://www.instagram.com/pacificcenterberkeley/","youtubeUrl":"https://www.youtube.com/user/TheInQueery","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro Pacífico para Crescimento Humano","description":"Fundado em 1973, o Centro Pacífico para Crescimento Humano é o centro LGBTQIA+ mais antigo da área da Baía, o terceiro mais antigo na nação, e opera a única clínica de saúde mental de escala ajustável para pessoas LGBTQIA+ e QTBIPOC e suas famílias no condado de Alameda."},{"id":"682fba48-f668-4fe6-89a7-05a90193e778","slug":"oakland-lgbtq-community-center","externalUrl":"https://www.oaklandlgbtqcenter.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","education-awareness","financial-aid-scholarships","community-stories","partner-resources"],"address":"3207 Lakeshore Ave, Oakland, CA 94610, USA","phoneNumber":"510-882-2286","country":"US","provinceOrState":"CA","city":"Oakland","county":"Alameda County","latLng":[37.8103802,-122.2459822],"socialMedia":{"yelpUrl":null,"googleMapsUrl":"https://goo.gl/maps/EnhwARKBin25SAmA6","facebookUrl":"https://www.facebook.com/oaklandlgbtqcommunitycenter/?notify_field=blurb&modal=profile_completion&notif_t=page_profile_blurb&notif_id=1499829595947085","twitterUrl":null,"instagramUrl":"https://www.instagram.com/oaklandlgbtqcenter","youtubeUrl":"https://youtu.be/3qxj1a9esuU","tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Centro Comunitário LGBTQ de Oakland","description":"O primeiro centro de serviço comunitário LGBTQ de Oakland, sem fins lucrativos 501c3, de todas as idades, totalmente inclusivo. Os serviços oferecidos incluem grupos de apoio, suporte para saúde mental, assistência habitacional, programa para jovens, clínica jurídica, despensa de alimentos etc. Programas especiais também são conduzidos para pessoas LGBTQ+ idosas e membros da comunidade transgênero."},{"id":"7fb1e1a6-bd81-4515-9aaa-70aea4580e55","slug":"gender-diversity","externalUrl":"https://genderdiversity.org","tags":["education-awareness","healthcare","youth-services","support-groups","parent-family-resources","social-services","non-binary","transmasculine","transfeminine"],"address":"6523 California Ave SW #144, Seattle, WA 98136","country":"US","provinceOrState":"WA","city":"Seattle","county":"King County","latLng":[47.544046,-122.387452],"phoneNumber":"1-833-3GENDER","email":"info@genderdiversity.org","title":"Diversidade de Gênero","description":"A Diversidade de Gênero melhora o bem-estar de crianças e adultos de todas as identidades e expressões de gênero, fornecendo educação, aumentando a conscientização e oferecendo insights sobre a ampla gama de experiências humanas. Também auxiliamos na criação de ambientes de apoio e não discriminatórios em escolas, equipes esportivas, locais de trabalho e provedores de saúde para indivíduos transgêneros e de gênero diverso."},{"id":"878e809b-12aa-483f-be01-3c51a4d331d6","slug":"national-center-for-transgender-equality","externalUrl":"https://transequality.org","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","parent-family-resources","partner-resources","education-awareness","financial-aid-scholarships"],"address":"1032 15th St NW #199, Washington, DC 20005, USA","phoneNumber":"(202) 642-4542","country":"US","provinceOrState":"CA","city":"Washington D.C.","county":"District of Columbia","latLng":[38.903438,-77.035037],"email":"ncte@transequality.org","socialMedia":{"blogUrl":"https://transequality.org/blog"},"title":"Centro Nacional para a Igualdade Transgênero","description":"O Centro Nacional para a Igualdade Transgênero é uma organização que advoga pela mudança de políticas e atitudes sociais para um maior entendimento e aceitação de pessoas transgênero. O NCTE fornece informações sobre questões que afetam a comunidade Transgênero, incluindo envelhecimento, anti-violência, emprego, famílias, saúde e HIV, habitação e desabrigados, e mais."},{"id":"8a206480-e41f-4bb6-9128-94d4b04cd997","slug":"the-inner-circle","externalUrl":"https://theinnercircle.org.za/","tags":["education-awareness","support-groups","spiritual"],"address":"Lester Rd, Wynberg, Cape Town, 7824, South Africa","phoneNumber":"+27 (0) 21 761 0037","country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-34.011883,18.469623],"email":"admin@theinnercircle.org.za","socialMedia":{"facebook":"https://www.facebook.com/pg/The-Inner-Circle-151896104833723/","twitter":"https://twitter.com/TIC_SouthAfrica"},"town":"Wynberg","title":"O Círculo Interno","description":"Uma comunidade muçulmana global destinada a trazer cura para muçulmanos marginalizados com base na orientação sexual e identidade de gênero por meio de espiritualidade, educação e construção de movimentos"},{"id":"8ab7bb47-206d-4872-a3ca-e692ce2036ec","slug":"florida-name-change-home","externalUrl":"https://www.floridanamechange.org/","tags":["legal","social-services"],"address":null,"phoneNumber":null,"country":"US","provinceOrState":"FL","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"Página Inicial de Mudança de Nome na Flórida","description":"Este site fornece um guia passo a passo para aqueles que desejam atualizar seu nome ou gênero na Flórida. As etapas incluem o preenchimento de uma petição em tribunal, e a atualização do cartão da Segurança Social, carteira de motorista, passaporte e certidão de nascimento."},{"id":"9e09fcfd-eb5b-4dd9-825c-ae3c3c5ce940","slug":"trans-lifeline-peer-support-and-resources","externalUrl":"https://translifeline.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships"],"address":null,"email":null,"phoneNumber":"(877) 565-8860","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TransLifeline/","twitterUrl":"https://twitter.com/TransLifeline","instagramUrl":"https://www.instagram.com/translifeline/?hl=en","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Trans Lifeline","description":"Trans Lifeline é uma organização liderada por trans que oferece apoio de pares e recursos para a comunidade transgênero. Com um foco no apoio comunitário, microbolsas e uma linha de ajuda, eles visam fornecer às pessoas trans as conexões e recursos de que precisam para prosperar. Trans Lifeline também defende a comunidade trans através de iniciativas como #SafeHotlines."},{"id":"a453684e-c325-457f-8841-05c0adabbbc0","slug":"the-trevor-project","externalUrl":"https://www.thetrevorproject.org/","tags":["youth-services","support-groups","mental-health","education-awareness"],"address":"West Hollywood, CA 90069, USA","email":null,"phoneNumber":"(212) 695-8650","country":"US","provinceOrState":"CA","city":"West Hollywood","county":"Los Angeles County","latLng":[34.0931603,-118.3783347],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/TheTrevorProject","twitterUrl":"https://twitter.com/trevorproject","instagramUrl":"https://www.instagram.com/trevorproject/","youtubeUrl":"https://www.youtube.com/thetrevorproject","tiktokUrl":"https://www.tiktok.com/@trevorproject","twitchUrl":null,"patreonUrl":null},"title":"The Trevor Project","description":"The Trevor Project é uma organização sem fins lucrativos americana que oferece serviços de prevenção ao suicídio para a juventude LGBTQ+. O site oferece recursos valiosos para a comunidade transgênero, incluindo intervenção em crises e linha de prevenção ao suicídio, TrevorChat, e TrevorText, bem como orientações sobre saúde mental, serviços sociais e grupos de apoio."},{"id":"ab058b91-49cf-4733-b3a3-47ea59b31a78","slug":"a-place-for-marsha","externalUrl":"https://www.aplaceformarshaofficial.org/","tags":["transmasculine","non-binary","transfeminine","legal","mental-health","social-services","support-groups","education-awareness","financial-aid-scholarships","community-stories"],"email":"info@aplaceformarshaofficial.org","socialMedia":{"tiktok":"https://www.tiktok.com/@aplaceformarsha"},"title":"Um Lugar para Marsha","description":"Um Lugar para Marsha é um de muitos projetos start-up com o objetivo de ajudar indivíduos Trans e famílias em estados cada vez mais perigosos para um lugar mais seguro. APFM iniciou sua jornada em março de 2023 em reação ao aumento da legislação anti-trans em todo o país. APFM agora se concentra em combinar Refugiados de estados vermelhos como colegas de quarto, cuidando cuidadosamente de uma casa de cada vez."},{"id":"af3483e3-d7f7-49d7-a4e9-b70e566bee98","slug":"good-hope-metropolitan-community-church","externalUrl":"https://www.goodhopemcc.org","tags":["spiritual"],"address":"18 Belmont Rd, Rondebosch, Cape Town, 7700, South Africa","phoneNumber":null,"country":"ZA","provinceOrState":"WC","city":"Cape Town","county":"City of Cape Town Metropolitan Municipality","latLng":[-33.9605258,18.474311],"email":"secretary@goodhopemcc.org","socialMedia":{"facebook":"https://www.facebook.com/goodhopemcc"},"town":"Rondebosch","title":"GOOD HOPE Metropolitan Community Church","description":"Uma comunidade cristã teologicamente progressista e inclusiva, fundada sobre os princípios de Jesus Cristo, que celebra a diversidade e oferece um espaço seguro e não julgador onde todos são bem-vindos. Parte de uma congregação cristã inclusiva baseada na Cidade do Cabo, África do Sul, e parte da maior denominação internacional conhecida como Metropolitan Community Churches (MCC)."},{"id":"b6955ff7-83b4-464f-8be8-72a50dc6a878","slug":"transvoicelessons","externalUrl":"https://www.transvoicelessons.com/","tags":["voice-training"],"address":null,"phoneNumber":null,"country":null,"provinceOrState":null,"city":null,"county":null,"latLng":null,"email":null,"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":"https://www.youtube.com/c/transvoicelessons","tiktokUrl":null,"twitchUrl":null,"patreonUrl":"https://www.patreon.com/transvoicelessons/posts"},"title":"TransVoiceLessons","description":"TransVoiceLessons oferece serviços de controle e liberação de voz de qualidade para indivíduos transgêneros e não-binários que visam soar mais masculinos, femininos ou andróginos."},{"id":"be5fc820-136d-4e7f-a3b5-ae6d103ef1ad","slug":"gender-centre","externalUrl":"https://gendercentre.org.au/","tags":["transmasculine","transfeminine","non-binary","mental-health","social-services","support-groups","education-awareness","healthcare"],"address":null,"phoneNumber":"02 9519 7599","country":"AU","provinceOrState":null,"city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":null,"title":"The Gender Centre Inc.","description":"The Gender Centre Inc. está fornecendo uma ampla gama de serviços especializados que permitem a exploração da identidade de gênero e assistência com a alleviação da disforia de gênero. Apoia pessoas trans e expressivas de gênero em todas as etapas de sua jornada enquanto exploram e vivem seu autêntico senso de si. Oferece acomodação, gerenciamento de caso, educação e treinamento, serviços de aconselhamento e saúde mental, grupos, notícias e recursos."},{"id":"cd48f2d0-8241-4fa5-a0aa-dc3cd3d386e8","slug":"rainbowrailroadorg","externalUrl":"https://RainbowRailroad.org","tags":["transfeminine","non-binary","transmasculine","legal","social-services"],"title":"RainbowRailroad.org","description":"Uma plataforma online vital dedicada a assistir e defender indivíduos LGBTQ+ que enfrentam perseguição e violência em todo o mundo. Com um compromisso inabalável, o site conecta aqueles em perigo imediato a recursos que salvam vidas, assistência de emergência e caminhos seguros para a segurança. Através de parcerias com organizações locais e uma rede de apoiadores compassivos, RainbowRailroad.org trabalha incansavelmente para fornecer defesa, assistência jurídica e apoio à realocação, permitindo que indivíduos escapem da perseguição e encontrem refúgio. Ao defender os direitos humanos, salvar vidas e promover um mundo mais inclusivo, RainbowRailroad.org serve como um farol de esperança e proteção para indivíduos LGBTQ+ em busca de segurança e liberdade."},{"id":"d59c0a9f-14ff-4c55-94d6-82313925be14","slug":"the-mckenzie-project","externalUrl":"https://www.themckenzieproject.org/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","youth-services","support-groups","education-awareness"],"address":"8390 W Flagler St STE 201, Miami, FL 33144, USA","email":"Info@TheMcKenzieProject.org","phoneNumber":"305-846-3186","country":"US","provinceOrState":"FL","city":"Miami","county":"Miami-Dade County","latLng":[25.769445,-80.3321284],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"O Projeto McKenzie","description":"Um recurso abrangente que oferece serviços, programas e eventos voltados para promover a justiça de gênero e servir a comunidade transgênero. Inclui serviços de apoio e recursos incluindo assistência médica, assistência jurídica, serviços de saúde mental e mais."},{"id":"d7378cc4-7726-4de1-8427-8203cb9b61ad","slug":"east-bay-trans-queer-counseling","externalUrl":"https://www.eastbaytranscounseling.org/","tags":["transmasculine","non-binary","transfeminine","mental-health","social-services","youth-services","education-awareness"],"email":"eastbaytranscounseling@gmail.com","address":"3099 Telegraph Ave, Berkeley, CA 94705, USA","phoneNumber":"781-775-7802","country":"US","provinceOrState":"CA","city":"Berkeley","county":"Alameda County","latLng":[37.8538725,-122.2596505],"socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":null,"twitterUrl":null,"instagramUrl":null,"youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Aconselhamento Trans & Queer da East Bay","description":"O Aconselhamento Trans & Queer da East Bay oferece serviços em escala móvel que incluem: Terapia individual localizada centralmente em Berkeley, CA Suporte através da exploração de gênero e transição Cartas de recomendação para hormônios e cirurgia Treinamentos profissionais para provedores de saúde mental, estudantes e empregadores. Sam Davis é um Trabalhador Social Clínico licenciado, transgênero, genderqueer (LCSW) especializado em trabalhar com adolescentes e adultos trans, queer, genderqueer e não conformes com o gênero. Eles têm 16 anos de experiência como provedor de saúde mental na East Bay, incluindo facilitação de grupo de apoio de pares, educação comunitária em conferências LGBTQI e 9 anos de prática clínica e aconselhamento em crises com pessoas severamente marginalizadas pelo Condado de Alameda. Eles são um forte e comprometido advogado com uma longa história de organização em nome de pessoas marginalizadas."},{"id":"e51c019c-8dfe-498e-b82e-4263a8f747e8","slug":"equality-florida","externalUrl":"https://www.eqfl.org/","tags":["legal","healthcare","education-awareness"],"address":null,"country":"US","provinceOrState":"FL","city":"St. Petersburg","county":null,"latLng":null,"email":null,"phoneNumber":"813-870-3735","socialMedia":{"yelpUrl":null,"googleMapsUrl":null,"facebookUrl":"https://www.facebook.com/equalityfl/","twitterUrl":"https://twitter.com/EqualityFlorida","instagramUrl":"https://www.instagram.com/equalityfl/","youtubeUrl":null,"tiktokUrl":null,"twitchUrl":null,"patreonUrl":null},"title":"Equality Florida","description":"A maior organização de advocacia LGBTQ da Flórida que trabalha na direção de escolas seguras e saudáveis, equidade de saúde LGBTQ, advocacia com HIV, proteções LGBTQ e mais. A organização realiza diversos eventos e garantiu apoio pró-igualdade, contribuindo para bolsas de saúde para transgêneros."},{"id":"e5b7c0b6-7106-4426-9809-7d59ebed9ec6","slug":"transhub","externalUrl":"https://www.transhub.org.au/","tags":["transmasculine","non-binary","transfeminine","legal","healthcare","mental-health","social-services","health-providers","community-stories","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":null,"county":null,"latLng":null,"email":null,"socialMedia":null,"title":"TransHub","description":"TransHub é uma plataforma digital de informação e recursos para todas as pessoas trans e de gênero diverso em NSW, seus entes queridos, aliados e provedores de saúde. Ele fornece acesso a informações e recursos muito necessários para uma comunidade que pode não ter tido acesso a tais informações à medida que cresceram ou evoluíram para seus autênticos. A informação varia de necessidades médicas como hormônios, cirurgias e listas de médicos a questões sociais e legais."},{"id":"e7d26256-017c-4d7e-90d2-30de9386cc03","slug":"twenty10","externalUrl":"https://twenty10.org.au/","tags":["transmasculine","non-binary","transfeminine","social-services","youth-services","support-groups","education-awareness"],"address":null,"phoneNumber":null,"country":"AU","provinceOrState":"NSW","city":"Sydney","county":null,"latLng":null,"email":null,"socialMedia":{"instagramUrl":"https://www.instagram.com/twenty10glcs/"},"title":"Twenty10","description":"A Twenty10, incluindo a GLCS, oferece diversos serviços que mudam a vida de jovens em todo o NSW que se identificam como lésbicas, gays, bissexuais, transgêneros ou diversidade de gênero, intersexuais, queer, assexuais ou estão questionando sua identidade. Seus serviços incluem acolhimento e encaminhamento, moradia e gestão de casos, aconselhamento, programas de apoio social e treinamento de inclusividade LGBTIQA+"},{"id":"eee5057f-7302-4392-b6aa-add70e3e8556","slug":"transgendermap","externalUrl":"https://transgendermap.com","tags":["transfeminine","non-binary","transmasculine","legal","healthcare","mental-health","social-services","community-stories","education-awareness"],"title":"Mapa Transgênero","description":"Transgendermap.com é um recurso online destinado a fornecer informações práticas e orientações para pessoas que estão questionando sua identidade de gênero ou que estão em algum lugar no espectro transgênero. O site inclui uma ampla gama de tópicos, como entender a terminologia transgênero, processos de transição, questões jurídicas, saúde e inúmeras histórias pessoais. Seu objetivo é ajudar os indivíduos a navegar em suas jornadas pessoais, fornecendo um \'mapa\' ou guia para os muitos aspectos da identidade de gênero e experiências transgêneros. Por favor, visite o site real para as informações mais atuais e precisas."},{"id":"fc8a7875-84dd-4df5-96ec-8aca153c8ea6","slug":"trans-families-home","externalUrl":"https://transfamilies.org","tags":["transmasculine","non-binary","transfeminine","parent-family-resources","support-groups","education-awareness"],"email":null,"phoneNumber":null,"address":null,"socialMedia":null,"title":"Famílias Trans","description":"Famílias Trans inspire esperança, aumentam a compreensão e criam um caminho visível para apoiar crianças trans e de gênero diverso e todos aqueles que tocam suas vidas. Fornecemos recursos, organizamos eventos e conectamos famílias a grupos de apoio."}]')}}]);